VALUES ('3700209900947', 'Deli pocket', 'Garniture (50%) : 17 % sauce crémeuse (eau, amidons modifiés de maïs et de pomme de terre, lactosérum en poudre (lait), poudre de lait entier, crème en poudre (lait), saccharose, sel, arômes naturels, huile de colza), 15% Edam (lait), 7 % Reblochon (lait) (dont colorant : rocou), 7 % lardons cuits fumés (poitrine de porc (origine France), sel, dextrose, arôme de fumée, acidifiant : acide citrique ; antioxydant : érythorbate de sodium ; consen/ateur : nitrite de sodium), 2% pommes de terre, 2% oignons pré frits (oignons, huile de tournesol). Pâte (50%) : farine de blé, eau, huile de tournesol, sel, sucre, levure de boulangerie, poudres à lever : diphosphates, carbonates de sodium ; fibre de blé, agent de traitement de la farine : L-cystéine. Traces éventuelles de moutarde, d\'œufs et de soja.', 'https://static.openfoodfacts.org/images/products/370/020/990/0947/front_fr.4.400.jpg', '7.8', '3.5', '34.2', '4.3', '', '9.5', '1.3', '0.511811023622047', '', '0');

